quantityType.description:
Acceleration, in physics, is the rate of change of velocity of an object.

The SI unit for this quantity is <em>metre per second squared</em> (m/s^2).

@see <a href="http://en.wikipedia.org/wiki/Acceleration">Wikipedia: Acceleration</a>

Angular acceleration is the rate of change of angular velocity.

The SI unit for this quantity is <em>radian per square second</em> (rad/s<sup>2</sup>).

@see <a href="http://en.wikipedia.org/wiki/Angular_acceleration">Wikipedia: Angular Acceleration</a>

Rate of change of angular displacement with respect to time.

The SI unit for this quantity is <em>radian per second</em> (rad/s).

@see <a href="http://en.wikipedia.org/wiki/Angular_speed">Wikipedia: Angular Speed</a>

In dimensional analysis, a dimensionless quantity is a quantity to which no physical dimension
is applicable. It is thus a bare number, and is therefore also known as a quantity of dimension one.

@see <a href="http://en.wikipedia.org/wiki/Dimensionless_quantity">Wikipedia: Dimensionless Quantity</a>

Electric capacitance is the ability of a body to store an electrical charge.

The SI unit for this quantity is <em>Farad</em> (F).

@see <a href="http://en.wikipedia.org/wiki/Capacitance">Wikipedia: Capacitance</a>

Electric conductance measures the ease with which an electric current passes through a conductor.

The SI unit for this quantity is <em>Siemens</em> (S).

@see <a href="http://en.wikipedia.org/wiki/Electrical_resistance_and_conductance">Wikipedia: Electric Conductance</a>

An electric current is a flow of electric charge.

The SI unit for this quantity is <em>Ampere</em> (A).

@see <a href="http://en.wikipedia.org/wiki/Electric_current">Wikipedia: Electric Current</a>

Capacity of a physical system to do work.

The SI unit for this quantity is <em>Joule</em> (J).

@see <a href="http://en.wikipedia.org/wiki/Energy">Wikipedia: Energy</a>

A Force is any interaction which tends to change the motion of an object.

The SI unit for this quantity is <em>Newton</em> (N).

@see <a href="http://en.wikipedia.org/wiki/Force">Wikipedia: Force</a>

Frequency is the number of occurrences of a repeating event per unit time.

The SI unit for this quantity is <em>Hertz</em> (Hz).

@see <a href="http://en.wikipedia.org/wiki/Frequency">Wikipedia: Frequency</a>

Illuminance is the total luminous flux incident on a surface, per unit area.

The SI unit for this quantity is <em>lux</em> (lx).

@see <a href="http://en.wikipedia.org/wiki/Illuminance">Wikipedia: Illuminance</a>

Length is the longest dimension of an object.

The SI unit for this quantity is <em>metre</em> (m).

@see <a href="http://en.wikipedia.org/wiki/Length">Wikipedia: Length</a>

Luminous flux is the measure of the perceived power of light.

The SI unit for this quantity is <em>lumen</em> (lm).

@see <a href="http://en.wikipedia.org/wiki/Luminous_flux">Wikipedia: Luminous Flux</a>

Magnetic flux density.

The SI unit for this quantity is <em>Tesla</em> (T).

@see <a href="http://en.wikipedia.org/wiki/Magnetic_field">Wikipedia: Magnetic Field</a>

Mass Flow Rate is the mass of a substance which passes per unit of time.

The SI unit for this quantity is <em>kilogram per second</em> (kg/s).

@see <a href="http://en.wikipedia.org/wiki/Mass_flow_rate">Wikipedia: Mass Flow Rate</a>

Power is the rate of doing work.

The SI unit for this quantity is <em>Watt</em> (W).

@see <a href="http://en.wikipedia.org/wiki/Power_(physics)">Wikipedia: Power</a>

Radioactivity is the property of spontaneous nuclear decay, or the frequency of that decay.

The SI unit for this quantity is <em>Becquerel</em> (Bq).

@see <a href="http://en.wikipedia.org/wiki/Radioactivity_(disambiguation)">Wikipedia: Radioactivity</a>

Speed is the distance traveled divided by the time of travel.

The SI unit for this quantity is <em>metre per second</em> (m/s).

@see <a href="http://en.wikipedia.org/wiki/Speed">Wikipedia: Speed</a>

Temperature is a comparative objective measure of hot and cold.

The SI unit for this quantity is <em>Kelvin</em> (K).

@see <a href="http://en.wikipedia.org/wiki/Temperature">Wikipedia: Temperature</a>

Timer is a period of existence or persistence.

The SI unit for this quantity is <em>second</em> (s).

@see <a href="http://en.wikipedia.org/wiki/Time">Wikipedia: Time</a>

Torque is the tendency of a force to rotate an object about an axis, fulcrum, or pivot.

The SI unit for this quantity is <em>newton metre</em> (N.m).

@see <a href="http://en.wikipedia.org/wiki/Torque">Wikipedia: Torque</a>

Volumetric Flow Rate is the volume of fluid passing a point in a system per unit of time.

The SI unit for this quantity is <em>cubic metre per second</em> (m<sup>3</sup>/s).

@see <a href="http://en.wikipedia.org/wiki/Rate_of_fluid_flow">Wikipedia: Volumetric Flow Rate</a>

A measure of material in its natural or "in situ" state.  This is typically
used to measure material prior to blasting and/or excavation.
@see <a href="https://mnw2k8r2-wiki.ap.cat.com/pages/viewpage.action?pageId=36640442">Glossary: Bank Cubic Meters</a>
